/*Table structure for table `coberturas_sociales` */

CREATE TABLE `coberturas_sociales` (
  `id_cobertura_social` smallint(5) unsigned NOT NULL AUTO_INCREMENT,
  `id_prov` int(10) unsigned NOT NULL,
  `rnos` char(6) NOT NULL,
  `nom_cobertura_social` varchar(255) NOT NULL,
  `sigla` varchar(50) DEFAULT NULL,
  `domicilio` varchar(255) DEFAULT NULL,
  `codigo_postal` char(4) DEFAULT NULL,
  `telefono` varchar(100) DEFAULT NULL,
  `email_web` varchar(255) DEFAULT NULL,
  `tipo_cobertura` char(1) NOT NULL COMMENT '1 = Obra Social del Sistema Nacional del Seguro de Salud; 2 = Otras obras sociales; 3 = Plan de salud; 4 = Prepaga; 9 = Se ignora',
  PRIMARY KEY (`id_cobertura_social`),
  UNIQUE KEY `idx_unique_rnos` (`rnos`),
  KEY `fk_id_prov` (`id_prov`),
  KEY `idx_nom_obra_social` (`nom_cobertura_social`),
  CONSTRAINT `fk_id_prov` FOREIGN KEY (`id_prov`) REFERENCES `provincias` (`id_prov`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=504 DEFAULT CHARSET=latin1;

